import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const Services = () => {
  return (
    <Box
      sx={{
        width: '100vh',
        padding: '50px',
        background: 'linear-gradient(to bottom, #304352, #d7d2cc)',
        color: 'white',
      }}
    >
      <Typography variant='h4' fontWeight={700} fontFamily='Roboto'>
        Our Services
      </Typography>

      {/* Cards layout for services */}
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          marginTop: '30px',
        }}
      >
        {/* Service Card 1 */}
        <Box
          sx={{
            width: '30%',
            padding: '20px',
            borderRadius: '16px',
            background: 'linear-gradient(to bottom, #1a2a6c, #b21f1f)',
            boxShadow: '10px 10px 20px rgba(0, 0, 0, 0.2)',
          }}
        >
          <Typography variant='h6' fontWeight={700} mb={2}>
            Service 1
          </Typography>
          <Typography variant='body1'>
            Description of Service 1. Provide details about what this service
            offers.
          </Typography>
        </Box>

        {/* Service Card 2 */}
        <Box
          sx={{
            width: '30%',
            padding: '20px',
            borderRadius: '16px',
            background: 'linear-gradient(to bottom, #09203f, #537895)',
            boxShadow: '10px 10px 20px rgba(0, 0, 0, 0.2)',
          }}
        >
          <Typography variant='h6' fontWeight={700} mb={2}>
            Service 2
          </Typography>
          <Typography variant='body1'>
            Description of Service 2. Provide details about what this service
            offers.
          </Typography>
        </Box>

        {/* Service Card 3 */}
        <Box
          sx={{
            width: '30%',
            padding: '20px',
            borderRadius: '16px',
            background: 'linear-gradient(to bottom, #0f2027, #203a43, #2c5364)',
            boxShadow: '10px 10px 20px rgba(0, 0, 0, 0.2)',
          }}
        >
          <Typography variant='h6' fontWeight={700} mb={2}>
            Service 3
          </Typography>
          <Typography variant='body1'>
            Description of Service 3. Provide details about what this service
            offers.
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default Services;
